export const signup = User => {
    return fetch("/signup", {
        method: "POST",
        headers: {
            Accept: "application/json",
           "Content-Type": "application/json" 
        },
        body: JSON.stringify(User)
    })
    .then(data => {
        return data.json();
    })
    .catch(err => {
        console.log(err)
    });
}
